function gotoTicket(){var e=document.getElementById("date").value,t=e.substring(0,4)+"/"+e.substring(5);window.location.href="/pipermail/talk/"+t}var currentYear=new Date().getFullYear(),currentMonth=new Date().getMonth()+1,yearDropdown=document.getElementById("date");yearDropdown.innerHTML="";for(var year=2023;year<=2024;year++)for(var endMonth=2024===year?Math.min(currentMonth,12):12,startMonth=2023===year?9:1,month=startMonth;month<=endMonth;month++){var e=document.createElement("option"),t=month<10?"0"+month:""+month;e.value=year+"-"+t,e.text=t+"/"+year,yearDropdown.appendChild(e)}
